//              COMPONENT FOR PROFILE CARD                  //

        // Importing Require Module :
import React from 'react';

        // Profile Card Component :
function Pro(){
    <div id="ProfileCard">
        <div id="ProfileImg">
            <img src="" alt="ERROR"></img>
        </div>
        <div id="ProfileContent">
            <strong>NAME : </strong> <span>Jnaid</span>
            <strong>PROFESSION : </strong> <span>Software Developer</span>
            
        </div>
    </div>
};


export default Pro;
